import React from 'react';

const Task = () => {
    return (
        <th>
            <td className="tasks-table__cell">id</td>
            <td className="tasks-table__cell">Task name</td>
            <td className="tasks-table__cell">1 / 10 hours</td>
            <td className="tasks-table__cell">Junior</td>
        </th>
    );
};

export default Task;
